<html>
    <head>
        <meta charset=\"UTF-8\">
        <title>{% block title %}Welcome!{% endblock %}</title>
        {#include bootstrap#}
        <link rel=\"stylesheet\" href=\"https://cdn.jsdelivr.net/npm/bootstrap@4.5.3/dist/css/bootstrap.min.css\" integrity=\"sha384-TX8t27EcRE3e/ihU7zmQxVncDAy5uIKz4rEkgIXeMed4M0jlfIDPvg6uqKI2xXr2\" crossorigin=\"anonymous\">
        <script src=\"https://code.jquery.com/jquery-3.5.1.slim.min.js\" integrity=\"sha384-DfXdz2htPH0lsSSs5nCTpuj/zy4C+OGpamoFVy38MVBnE+IbbVYUew+OrCXaRkfj\" crossorigin=\"anonymous\"></script>
        <script src=\"https://cdn.jsdelivr.net/npm/bootstrap@4.5.3/dist/js/bootstrap.bundle.min.js\" integrity=\"sha384-ho+j7jyWK8fNQe+A12Hb8AhRq26LrZ/JpcUGGOn+Y7RsweNrtN/tE3MoK7ZeZDyx\" crossorigin=\"anonymous\"></script>
        {#end include bootstrap#}
        {% block stylesheets %}

        {% endblock %}
    </head>
    <body>
        <header>
            <!-- Fixed navbar -->
            <nav class=\"navbar navbar-expand-md navbar-dark fixed-top bg-dark\">
                <div class=\"container\">
                    <a class=\"navbar-brand\" href=\"#\">Fixed navbar</a>
                    <button class=\"navbar-toggler\" type=\"button\" data-toggle=\"collapse\" data-target=\"#navbarCollapse\" aria-controls=\"navbarCollapse\" aria-expanded=\"false\" aria-label=\"Toggle navigation\">
                        <span class=\"navbar-toggler-icon\"></span>
                    </button>
                    <div class=\"collapse navbar-collapse\" id=\"navbarCollapse\">
                        <ul class=\"navbar-nav mr-auto\">
                            <li class=\"nav-item {{ app.request.get('_route') == 'index' ? 'active' }}\">
                                <a class=\"nav-link\" href=\"{{ path('index') }}\">Home</a>
                            </li>
                            <li class=\"nav-item {{ app.request.get('_route') == 'shopList' ? 'active' }}\">
                                <a class=\"nav-link\" href=\"{{ path('shopList') }}\">Магазин</a>
                            </li>

                        </ul>
                        <div class=\"mt-2 mt-md-0\">
                            <a href=\"{{ path('shopCart') }}\" class=\"btn btn-outline-success my-2 my-sm-0 {{ app.request.get('_route') == 'shopCart' ? 'active' }}\">Корзина</a>
                        </div>
                    </div>
                </div>
            </nav>
        </header>
        <div class=\"mt-5\">
            <main role=\"main\" class=\"flex-shrink-0\">
                <div class=\"container\">
                    <div class=\"mt-1\">&nbsp;</div>
                    <div class=\"mt-2\">
                        {% block body %}{% endblock %}
                    </div>
                </div>
            </main>
        </div>
    </body>
</html>
